import React from "react";
import { Link } from "react-scroll"; // Import Link for smooth scrolling
import { useNavigate } from "react-router-dom";

const Navbar = () => {
  const navigate = useNavigate();

  // Logout function to clear login status and redirect to home
  const handleLogout = () => {
    localStorage.removeItem("isLoggedIn");
    navigate("/");
  };

  return (
    <nav className="backdrop-blur-lg bg-opacity-20 bg-black fixed top-0 w-full p-4 flex justify-between items-center shadow-lg z-50">
      {/* QuickRent Logo */}
      <h1 className="text-3xl font-bold text-cyan-400 cursor-pointer">
        QuickRent
      </h1>

      {/* Navigation Links */}
      <ul className="hidden md:flex space-x-6 text-white">
        {/* Features Section Link */}
        <li>
          <Link
            to="features"  // Scrolls to the 'features' section
            smooth={true}
            duration={500}
            activeClass="text-cyan-400 border-b-2 border-cyan-400"  // Active link style
            className="cursor-pointer hover:text-cyan-400 transition"
          >
            Features
          </Link>
        </li>
        {/* Gadgets Section Link */}
        <li>
          <Link
            to="gadgets"  // Scrolls to the 'gadgets' section
            smooth={true}
            duration={500}
            activeClass="text-cyan-400 border-b-2 border-cyan-400"  // Active link style
            className="cursor-pointer hover:text-cyan-400 transition"
          >
            Gadgets
          </Link>
        </li>
        {/* Contact Section Link */}
        <li>
          <Link
            to="contact"  // Scrolls to the 'contact' section
            smooth={true}
            duration={500}
            activeClass="text-cyan-400 border-b-2 border-cyan-400"  // Active link style
            className="cursor-pointer hover:text-cyan-400 transition"
          >
            Contact
          </Link>
        </li>
      </ul>

      {/* Logout Button */}
      <button
        onClick={handleLogout}
        className="bg-cyan-400 text-black px-6 py-2 rounded-md hover:bg-cyan-500 transition"
      >
        Logout
      </button>
    </nav>
  );
};

export default Navbar;
